import React, {Component} from 'react'
import data from './sectionInfo.json'

class DisplayTable extends Component {

    render() {
        return (
            <div>
                <h1>{data.sectionID}</h1>
            </div>
        )
    }
        

    
}
    
export default DisplayTable
